import React from "react";
import ReactDOM from "react-dom";
// import "./index.css";
// import App from "./App";

function Card() {
  return (
    <div className="cards">
      <div className="card">
        <img
          src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRiAci3ZPn4Pu1BEqPsObJfMb_G02aJ_tzPxaGEmvEuAZ32LiwK"
          alt="myPic"
          className="card_img"
        />
        <div>
          <span className="card_category"> A Netflix Orignal Series</span>
          <h3 className="card_title">DARK</h3>
          <a href="https://www.netflix.com/in/title/80100172" target="_black">
            <button>Watch Now</button>
          </a>
        </div>
      </div>
    </div>
  );
}

ReactDOM.render(
  <>
    <Card />
  </>,
  document.getElementById("root")
);
